import React, { useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import { FaFacebook, FaYoutubeSquare, FaInstagram, FaLinkedin, FaMapMarkerAlt, FaEnvelope, FaPhone, FaGlobe, FaArrowUp } from 'react-icons/fa';
import { Link } from 'react-router-dom';
import logo from '../assets/img/logo.png';
import makeInIndiaLogo from '../assets/img/made-in-india.png'; // Replace with actual path

const ContactFooter = () => {
  const { pathname } = useLocation();

  useEffect(() => {
    window.scrollTo(0, 0);
  }, [pathname]);

  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: 'smooth',
    });
  };

  // Form submission functionality
  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData(e.target);
    const url = "https://api.web3forms.com/submit";
    try {
      const response = await fetch(url, {
        method: "POST",
        body: formData,
      });
      if (response.ok) {
        alert("Our team has received your message!");
      } else {
        throw new Error("Failed to send message");
      }
    } catch (error) {
      console.error("Error sending message:", error);
      alert("An error occurred. Please try again later.");
    }
  };

  return (
    <div>
      {/* Contact Us Section */}
      <div className="relative bg-cover bg-center py-8">
        <div className="relative z-10 flex justify-center">
          <h2 className="text-4xl font-bold text-white">Contact Us</h2>
        </div>
      </div>

      {/* Contact Form */}
      <div id="contact" className="relative bg-white py-8">
        <div className="max-w-3xl mx-auto p-6 shadow-lg"> {/* Expanded for wider layout */}
          <form onSubmit={handleSubmit} className="space-y-6">
            <input type="hidden" name="access_key" value="f697ed8c-5c6d-497d-9f13-51824b9c04b1" />
            <div>
              <label className="block text-lg font-medium text-gray-700">Name</label>
              <input type="text" name="name" placeholder="Enter your name" className="mt-2 p-3 w-full border rounded-lg focus:ring-orange-500" />
            </div>
            <div>
              <label className="block text-lg font-medium text-gray-700">Email</label>
              <input type="email" name="email" placeholder="Enter your email" className="mt-2 p-3 w-full border rounded-lg focus:ring-orange-500" />
            </div>
            <div>
              <label className="block text-lg font-medium text-gray-700">Message</label>
              <textarea name="message" placeholder="Write your message" className="mt-2 p-3 w-full h-32 border rounded-lg focus:ring-orange-500"></textarea>
            </div>
            <div className="flex justify-center">
              <button type="submit" className="bg-orange-600 text-white py-3 px-6 rounded-lg hover:bg-orange-700 focus:ring-orange-600">Submit</button>
            </div>
          </form>
        </div>
      </div>

      {/* Footer Section */}
      <footer className="bg-white text-gray-700">
        <div className="max-w-screen-xl mx-auto grid grid-cols-1 md:grid-cols-3 gap-8 py-10 px-4">
          {/* Logo and Contact Info */}
          <div>
            <img src={logo} alt="Logo" className="h-16 mb-4" />
            <hr className="border-t border-black mb-8 w-3/5" />
            <div className="space-y-4">
              <p className="flex items-center">
                <FaMapMarkerAlt className="mr-2" /> Pune, Maharashtra, India
              </p>
              <p className="flex items-center">
                <FaEnvelope className="mr-2" /> support@voyease.in
              </p>
              <p className="flex items-center">
                <FaPhone className="mr-2" /> +91-9152851516
              </p>
              <p className="flex items-center">
                <FaGlobe className="mr-2" /> www.VoyEase.in
              </p>
            </div>
            {/* Social Media Icons */}
            <div className="flex space-x-6 mt-6">
              <a href="https://www.facebook.com" className="hover:text-gray-800"><FaFacebook size={24} /></a>
              <a href="https://www.youtube.com" className="hover:text-gray-800"><FaYoutubeSquare size={24} /></a>
              <a href="https://www.instagram.com" className="hover:text-gray-800"><FaInstagram size={24} /></a>
              <a href="https://www.linkedin.com" className="hover:text-gray-800"><FaLinkedin size={24} /></a>
            </div>
          </div>

          {/* Links */}
          <div className="flex space-x-8 mt-16">
            <div>
              <h3 className="font-bold text-lg mb-4">Company</h3>
              <ul className="space-y-2">
                <li><Link to="/" className="hover:text-gray-800">Home</Link></li>
                <li><Link to="/about" className="hover:text-gray-800">About Us</Link></li>
                <li><Link to="/contact" className="hover:text-gray-800">Contact Us</Link></li>
                <li><Link to="/privacy-policy" className="hover:text-gray-800">Privacy Policy</Link></li>
              </ul>
            </div>
            <div>
              <h3 className="font-bold text-lg mb-4">Links</h3>
              <ul className="space-y-2">
                <li><Link to="/customer-terms" className="hover:text-gray-800">Customer Terms</Link></li>
                <li><Link to="/tour-guide-terms" className="hover:text-gray-800">Tour Guide Terms</Link></li>
                <li><Link to="/tour-buddy-terms" className="hover:text-gray-800">Tour Buddy Terms</Link></li>
              </ul>
            </div>
          </div>
        </div>

        {/* Scroll to Top and Make in India Logo */}
        <div className="absolute bottom-24 right-14 flex flex-col items-center space-y-4">
          <button onClick={scrollToTop} className="bg-black text-white p-2 rounded-full hover:bg-gray-800 transition"><FaArrowUp size={24} /></button>
          <img src={makeInIndiaLogo} alt="Make in India" className="h-16" />
        </div>

        {/* Footer Bottom */}
        <div className="bg-black py-8 text-white text-center">
          <p>Â© 2024 VoyEase. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default ContactFooter;
